import React, { useState, useEffect } from 'react';
import { fetchProjects, createProject } from '../services/api';

const ProjectList = () => {
  const [projects, setProjects] = useState([]);
  const [newProject, setNewProject] = useState({ name: '', client: '', startDate: '', endDate: '' });

  useEffect(() => {
    const getProjects = async () => {
      try {
        const data = await fetchProjects();
        setProjects(data);
      } catch (error) {
        console.error(error);
      }
    };
    getProjects();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const createdProject = await createProject(newProject);
      setProjects([...projects, createdProject]);
      setNewProject({ name: '', client: '', startDate: '', endDate: '' });
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div>
      <h1>Project List</h1>
      <ul>
        {projects.map((project) => (
          <li key={project.id}>{project.name} - {project.client}</li>
        ))}
      </ul>
      <h2>Add New Project</h2>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          placeholder="Name"
          value={newProject.name}
          onChange={(e) => setNewProject({ ...newProject, name: e.target.value })}
        />
        <input
          type="text"
          placeholder="Client"
          value={newProject.client}
          onChange={(e) => setNewProject({ ...newProject, client: e.target.value })}
        />
        <input
          type="date"
          value={newProject.startDate}
          onChange={(e) => setNewProject({ ...newProject, startDate: e.target.value })}
        />
        <input
          type="date"
          value={newProject.endDate}
          onChange={(e) => setNewProject({ ...newProject, endDate: e.target.value })}
        />
        <button type="submit">Add Project</button>
      </form>
    </div>
  );
};

export default ProjectList;
